            cours: ["Objet Connectée", "Structure de donnée"],
          },
    ]);

    return (
        <React.Fragment>
            <ListeEtudiant items={loadedEtudiants} />
        </React.Fragment>
    );
  }
export default ListeEtudiantPage;
